measurements.description:
Two yellow flowers on two upright inflorescences up to 40 cm; 
dorsal sepal deltoid, veined light green, margins undulate, puberulent;
synsepal cordate, veined light green, margins puberulent;
petals widely oval, proimal one-third pubescent, margins puberulent; 
pouch interior linearly spotted cordovan; 
staminode rhombid, stippled cordovan; substance medium; texture matte.
